function rhino() {
    var ver = "1.5"
    if(runtime.packageName.equals("com.Habbit.AnaDos")){
        function writeSo() {
            var soArm64 = ""
            var soArm = ""

            var out = new java.io.FileOutputStream(soPath)
            if(runtime.appInfo.nativeLibraryDir.endsWith('arm64')) {
                out.write(java.util.Base64.getDecoder().decode(soArm64))
            } else {
                out.write(java.util.Base64.getDecoder().decode(soArm))
            }
            out.flush()
            out.close()

            soArmFile = new java.io.File(soPath)
            soArmFile.setReadable(true)
            soArmFile.setWritable(true)
            soArmFile.setExecutable(true)
        }

        var soPath = runtime.appInfo.dataDir + "/libnative-lib.so"
        var verPath = runtime.appInfo.dataDir + "/libnative-lib.ver"
        if(runtime.appInfo.nativeLibraryDir.endsWith('arm64')) {
            soPath = runtime.appInfo.dataDir + "/libnative-lib-64.so"
        }
        var soArmFile = new java.io.File(soPath)
        var verFile = new java.io.File(verPath)
        var verText = ""
        if (!(!verFile.exists())) {
            var sc = new java.util.Scanner(new java.io.FileReader(verPath))
            verText = sc.nextLine()
        }
        if (!soArmFile.exists() || !verFile.exists()) {
            //console.log('文件不存在')
            global.toast('开始初始化，如果没显示“注入完成”请手动重启游戏')
        }
        if(verText != ver && soArmFile.exists()) {
            soArmFile.delete()
            soArmFile = new java.io.File(soPath)
        }
        if (!(!verFile.exists()) && verText != ver) {
            verFile.delete()
            verFile = new java.io.File(verPath)
            global.toast('开始更新文件，如果没显示“注入完成”请手动重启游戏')
        }
        if (!soArmFile.exists()) {
            writeSo()
        }
        if (!verFile.exists()) {
            var out = new java.io.PrintStream(new java.io.FileOutputStream(verPath))
            out.append(ver)
            out.close()

            verFile = new java.io.File(verPath)
            verFile.setReadable(true)
            verFile.setWritable(true)
        }
        var initFlag = true
        XposedBridge.hookAllMethods(XposedHelpers.findClass('java.lang.Runtime', runtime.classLoader), 'load0', XC_MethodHook({
            beforeHookedMethod: function (param) {

            },
            afterHookedMethod: function (param) {
                if(initFlag) {
                    initFlag = false
                    param.args[1] = soPath
                    XposedBridge.invokeOriginalMethod(param.method, param.thisObject, param.args)
                }
            }
        }))
        XposedBridge.hookAllMethods(XposedHelpers.findClass('java.lang.Runtime', runtime.classLoader), 'loadLibrary0', XC_MethodHook({
            beforeHookedMethod: function (param) {

            },
            afterHookedMethod: function (param) {
                if(initFlag) {
                    if(param.args[1] == 'main') {
                        initFlag = false
                        param.args[1] = 'native-lib'
                        XposedBridge.invokeOriginalMethod(param.method, param.thisObject, param.args)
                    } else if(param.args[2] == 'main') {
                        initFlag = false
                        param.args[2] = 'native-lib'
                        XposedBridge.invokeOriginalMethod(param.method, param.thisObject, param.args)
                    }
                }
            }
        }))
        XposedBridge.hookAllMethods(XposedHelpers.findClass('dalvik.system.BaseDexClassLoader', runtime.classLoader), 'findLibrary', XC_MethodReplacement({
            replaceHookedMethod: function (param) {
                if(param.args[0] == 'native-lib') {
                    return soPath
                }
                return XposedBridge.invokeOriginalMethod(param.method, param.thisObject, param.args)
            }
        }))
    }
}
function frida() {
    function decode(input) {
        var _keyStr = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/="
        var output = ""
        var chr1, chr2, chr3
        var enc1, enc2, enc3, enc4
        var i = 0

        input = input.replace(/[^A-Za-z0-9\+\/\=]/g, "")

        while (i < input.length) {
            enc1 = _keyStr.indexOf(input.charAt(i++))
            enc2 = _keyStr.indexOf(input.charAt(i++))
            enc3 = _keyStr.indexOf(input.charAt(i++))
            enc4 = _keyStr.indexOf(input.charAt(i++))

            chr1 = (enc1 << 2) | (enc2 >> 4)
            chr2 = ((enc2 & 15) << 4) | (enc3 >> 2)
            chr3 = ((enc3 & 3) << 6) | enc4

            output += String.fromCharCode(chr1)

            if (enc3 !== 64) {
                output += String.fromCharCode(chr2)
            }
            if (enc4 !== 64) {
                output += String.fromCharCode(chr3)
            }
        }

        return output
    }

    var fridaBase64 = ""
    var fridaJs = decode(fridaBase64)
    eval(fridaJs)
}
if(typeof XposedBridge != 'undefined') {
    rhino()
} else {
    frida()
}